import React from 'react';
import {withRouter} from 'next/router';

const ArticelV = (props)=>{
    const {articles} = props;
    return(
        <div>
             <ul>
                 {articles && articles.length}
             </ul>
        </div>
    )
}

export default withRouter(ArticelV)
